import { ValidationErrors,FormGroup,ValidatorFn, AbstractControl } from "@angular/forms";

export const crossfieldValidation: ValidatorFn=(
  control: FormGroup
  ): ValidationErrors|null  =>{
  const origin =control.value['origin'];
  const destination=control.value['destination'];
  return origin&& destination && origin!= destination? null:
  {fieldsNotEqual:true};
};
